import styled from 'styled-components';

export const headerContainer = styled.div`
  background-color: 'rgba(34, 37, 75, 1)';
`;

export const header = styled.div`
  display: flex;
  text-align: center;

  img {
    margin-right: 20px;
  }

  ul {
    list-style: none;
  }
  li {
    margin-right: 20px;
    float: left;
  }
`;
